// Popup
$(function() {
    $(document).on('click','[data-modal-target]', function() {
       $('.modal-overlay').fadeIn(300, 0);
       var anchor = $(this).attr('data-modal-target');
       modalPos(anchor);
       $(anchor).fadeIn(300, 0);
   });
    $(document).keyup(function(e) {
       if (e.keyCode == 27) {
           hideModal();
       }
   });
    $(document).on('click','.modal-close', function() {
       hideModal();
   });
    $(document).on('click','.modal-overlay', function() {
       hideModal();
   });
    function hideModal() {
        $('.modal-overlay, .modal-block').fadeOut(300, 0);
    };
    function modalPos(anchor) {
        modalWidth = $(anchor).outerWidth(true);
        modalHeight = $(anchor).outerHeight(true);
        $(anchor).css("top", ($(window).height() - modalHeight) / 2 + $(window).scrollTop() + "px");
        $(anchor).css("left", ($(window).width() - modalWidth) / 2 + $(window).scrollLeft() + "px");
    }
});